import React, { useState } from 'react';
import CombinedForm from '../cmpts/Patient/CombinedForm';
import PatientPage from '../cmpts/Patient/PatientPgae';
import { Link } from 'react-router-dom';

function App() {
  const [selectedComponent, setSelectedComponent] = useState('post'); // Default to 'post'

  return (
    <div>
      <div>
        {/* Use Link component for navigation */}
        <Link to="/patient/create-post" className="btn btn-outline-primary mx-2">
          Create Post
        </Link>
        <Link to="/patient/patient-page" className="btn btn-outline-primary">
          Patient Page
        </Link>
      </div>

      {selectedComponent === 'post' && <CombinedForm />}
      {selectedComponent === 'card' && <PatientPage />}
    </div>
  );
}

export default App;
